# Construct candidate columns list
cols = []

# Add first three basis vectors
cols.append((1,0,0))
cols.append((0,1,0))
cols.append((0,0,1))

# Add 12 more (1, a, b) with some pattern ensure distinct and not multiples
# We'll brute pick all (1,a,b) w 0<=a,b<7 and ensure property distinct and not multiples with earlier.
def is_multiple(v, w, q=7):
    # return True if w = k*v for some nonzero k in GF(q)
    if v == (0,0,0) or w == (0,0,0):
        return False
    for k in range(1,q):
        if tuple((k*vi)%q for vi in v) == w:
            return True
    return False

# We'll iterate possible a,b to build until 15
for a in range(7):
    for b in range(7):
        v=(1,a,b)
        # Skip duplicates
        if v in cols: continue
        # Ensure not multiple with existing
        good=True
        for u in cols:
            if is_multiple(u,v):
                good=False
                break
        if good:
            cols.append(v)
        if len(cols)==15:
            break
    if len(cols)==15:
        break

