from itertools import combinations, product

def has_codeword_weight_leq(weight, H, p):
    n = H.shape[1]
    for idx in combinations(range(n), weight):
        # create variable vector of scalars 1..p-1 for each chosen index
        for coeffs in product(range(1,p), repeat=weight):
            # Build vector x of length n
            x = np.zeros(n, dtype=int)
            for i,c in zip(idx, coeffs):
                x[i]=c
            # Check
            if np.all(np.mod(H.dot(x), p)==0):
                return True, idx, coeffs
    return False, None, None

